import React from "react";
import { RadioGroup } from "react-materialize";

import "../../constants/products";
import products from "../../constants/products.js";

const ProductForm = props => {

    let currentProduct = products.products.pos.questions1.map(() => {
        return(
            <div className="customRadio">
                <input 
                type="radio" name="product"
                id={products.products.pos.name} value="test"/>
                <label for='test'>
                <img 
                 src="//placekitten.com/151/151" 
                 alt="I'm happy" />
                </label>
            </div>)
    });

    
    return(
        <div className="radioDiv">
            {/* {currentProduct}
            */}

            <input type="radio" name="test" id="test1" value={1} />
            <label for="test1">Test 1</label>
            <input type="radio" name="test" id="test2" value={1} />
            <label for="test2">Test 2</label>
        </div>
    )
};

export default ProductForm;
